        "## Main goal of the project"
      ],
      "metadata": {
        "id": "agXJOYO3AohU"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "The porpuse of the project is to analise the martket of new coders. Since the company we're working for creates content for people who wants to learn coding we would like to know a bit more about potencial customers eg.\n",
        "* What domain is interesing for them.\n",
        "* Where are these new coders located.\n",
        "* What are the locations with the greatest number of new coders.\n",
        "* How much money new coders are willing to spend on learning."
      ],
      "metadata": {
        "id": "TVVCHJgfAsCF"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "## Sample Representatity"
      ],
      "metadata": {
        "id": "4rye5yFt_dqW"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Before starting to analyze the sample data we have, we need to clarify whether it's representative for our population of interest and it has the right categories of people for our purpose."
      ],
      "metadata": {
        "id": "ek7OvvPhCNJm"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "head(data %>%\n",
        "  group_by(JobRoleInterest) %>%\n",
        "  summarise(freq = n() * 100/nrow(data)) %>%\n",
        "  arrange(desc(freq)), 10)"
      ],
