    {
      "cell_type": "markdown",
      "source": [
        "The information in the table above is quite granular, but from a quick scan it looks like:\n",
        "\n",
        "* A lot of people are interested in web development (full-stack _web development_, front-end _web development_ and back-end _web development_).\n",
        "* A few people are interested in mobile development.\n",
        "* A few people are interested in domains other than web and mobile development.\n",
        "\n",
        "It's also interesting to note that many respondents are interested in more than one subject. It'd be useful to get a better picture of how many people are interested in a single subject and how many have mixed interests.\n"
      ],
      "metadata": {
        "id": "IYejDx1fCvpS"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Split each string in the 'JobRoleInterest' column\n",
        "splited_interests <- data %>%\n",
        "  select(JobRoleInterest) %>%\n",
        "  tidyr::drop_na() %>%\n",
        "  rowwise %>%\n",
        "  mutate(opts = length(stringr::str_split(JobRoleInterest, \",\")[[1]]))"
      ],
      "metadata": {
        "id": "UEZ3A9Z3_ziJ"
      },
      "execution_count": 8,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "# Frequency table for the var describing the number of options\n",
        "n_of_options <- splited_interests %>%\n",
        "  ungroup() %>%\n",
        "  group_by(opts) %>%\n",
        "  summarize(freq = n() * 100/ nrow(splited_interests))\n",
        "n_of_options"
      ],
