    {
      "cell_type": "markdown",
      "source": [
        "It turns out that only 31.65% of the participants have a clear idea about what programming niche they'd like to work in, while the vast majority of students have mixed interests. But given that we offer courses on various subjects, the fact that new coders have mixed interest might be actually good for us.\n",
        "\n",
        "The focus of our courses is on web and mobile development, so let's find out how many respondents chose at least one of these two options."
      ],
      "metadata": {
        "id": "H1JNiCqAEA5p"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Frequency table\n",
        "web_or_moblie <- stringr::str_detect(data$JobRoleInterest, \"Web Developer|Mobile Developer\")\n",
        "freq_table <- table(web_or_moblie)\n",
        "freq_table <- freq_table * 100/ sum(freq_table)\n",
        "freq_table"
      ],
      "metadata": {
        "colab": {
          "base_uri": "https://localhost:8080/",
          "height": 69
        },
        "id": "6rp6FrunDaQz",
        "outputId": "e2b3ed5c-ca1e-4d7c-d8b2-bd8927db7aac"
