    {
      "cell_type": "markdown",
      "source": [
        "## Finding the market"
      ],
      "metadata": {
        "id": "R-OANJRrGpQh"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Because the data set provides information at a country level, we can think of each country as an individual market. This means we can frame our goal as finding the two best countries to advertise in."
      ],
      "metadata": {
        "id": "DksiY0ENGr3w"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Isolate the participants that answered what role they'd be interested in\n",
        "data_good <- data %>%\n",
        "  tidyr::drop_na(JobRoleInterest)"
      ],
      "metadata": {
        "id": "mGFOX5wgE5Px"
      },
      "execution_count": 19,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "# Frequency tables with absolute and relative frequencies\n",
        "# Display the frequency tables in a more readable format\n",
        "data_good_plot <- data_good %>%\n",
        "  group_by(CountryLive) %>%\n",
        "  summarise(`Absolute Freq` = n(),\n",
        "`Percentage` = round(n() * 100 / nrow(data_good),2)) %>%\n",
        "  arrange(desc(Percentage)) %>%\n",
        "  slice(1:5)\n"
      ],
      "metadata": {
        "id": "pP2fwPmZHGUQ"
      },
      "execution_count": 30,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "ggplot(data_good_plot,\n",
        "aes(x = CountryLive, y = Percentage, fill = CountryLive)) +\n",
        "  geom_bar(stat = 'identity') +\n",
        " geom_text(aes(label = paste0(Percentage, \"%\")),\n",
        "            vjust = -0.5) +\n",
        "  theme(legend.position = 'none')"
      ],
