    {
      "cell_type": "markdown",
      "source": [
        "## Spending Money for Learning"
      ],
      "metadata": {
        "id": "CNa4ddxJJeo4"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Now we would like to know how much money new coders are willing to spend for learning app."
      ],
      "metadata": {
        "id": "ZRNbB2YNJgjH"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Replace 0s with 1s to avoid division by 0\n",
        "data_good <- data_good %>%\n",
        "  mutate(MonthsProgramming = replace(MonthsProgramming, MonthsProgramming == 0,1))"
      ],
      "metadata": {
        "id": "-KDnLl9rIK9d"
      },
      "execution_count": 34,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "# New column for the amount of money each student spends each month\n",
        "data_good <- data_good %>%\n",
        "  mutate(money_per_month = MoneyForLearning/MonthsProgramming)"
      ],
      "metadata": {
        "id": "J8W0ypwpJ_VA"
      },
      "execution_count": 35,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "data_good %>%\n",
        "  summarise(na_count = sum(is.na(money_per_month))) %>%\n",
        "  pull(na_count)"
