    {
      "cell_type": "markdown",
      "source": [
        " Now, when we romoved outliers we can see that there is significant difference betweent amount of money people in India and Canada are willing to spend. We will compute hom much profit we could generate from these two markets because even though people in Canada are willing to pay more, there are a lot more potencial customers in India. Obviolusly we can reject United Kingdom since there are not many potencial customers and they are willing to spend a lot less money."
      ],
