    {
      "cell_type": "code",
      "source": [
        "plot_market <- only_4 %>%\n",
        "  group_by(CountryLive) %>%\n",
        "  summarize(TotalProfit = round((mean(money_per_month)) * n())) %>%\n",
        "  arrange(desc(TotalProfit))"
      ],
      "metadata": {
        "id": "PU_lXqffWFTg"
      },
      "execution_count": 78,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "ggplot(plot_market,\n",
